import React from 'react';
import { useSelector } from 'react-redux';


function App() {
	const counter = useSelector(state => state.counter);
	return (
	    <div className="App">
	    	<h1>counter {counter}</h1>

	    	<h3>Only log on info</h3>
	    </div>
	);
}

export default App;
